import {
  GET_USER_PROFILE,
  GET_USER_PROFILE_SUCCESS,
  GET_USER_PROFILE_ERROR,
} from "../action/types";

const initialState = {
  profile: null,
  profiles: null,
  repos: [],
  loading: false,
  error: {},
};
export default function (state = initialState, action) {
  const { type, payload } = action;
  switch (type) {
    case GET_USER_PROFILE: {
      return {
        ...state,
      };
    }
    case GET_USER_PROFILE_SUCCESS: {
      return {
        ...state,
      };
    }
    case GET_USER_PROFILE_ERROR: {
      return {
        ...state,
      };
    }
    default: {
      return state;
    }
  }
}
